import FA from "react-fontawesome";

const Tips = props => (
  <div>
    <p>Here are a few tips on how to approach these questions</p>

    <ul style={{ paddingTop: "20px" }}>
      <FA name="radiation" style={{ color: "#FFCC00" }} />
      <li>Keep your responses simple</li>
    </ul>
  </div>
);

export default Tips;
